If we only wanted to support the use case where all columns referenced in the selection also exist in the projection we could get away with some very simple logic to build the query plan. fun createDataFrame(select: SqlSelect, tables: Map<String, DataFrame>) : DataFrame { // get a reference to the data source var df = tables[select.tableName] ?: throw SQLException("No table named '${select.tableName}'") val projectionExpr = select.projection.map { createLogicalExpr(it, df) } if (select.selection == null) { // apply projection return df.select(projectionExpr) } // apply projection then wrap in a selection (filter) return df.select(projectionExpr) .filter(createLogicalExpr(select.selection, df))
} However, because the selection could reference both inputs to the projections and outputs from the projection we need to create a more complex plan with an intermediate projection. The first step is to determine which columns are references by the selection filter expression. To do this we will use the visitor pattern to walk the expression tree and build a mutable set of column names. Here is the utility method we will use to walk the expression tree. private fun visit(expr: LogicalExpr, accumulator: MutableSet<String>) { when (expr) { is Column -> accumulator.add(expr.name) is Alias -> visit(expr.expr, accumulator) is BinaryExpr -> { visit(expr.l, accumulator) visit(expr.r, accumulator) } }
} With this in place we can now write the following code to convert a SELECT statement into a valid logical plan. This code sample is not perfect and probably contains some bugs for edge cases where there are name clashes between columns in the data source and aliased expressions but we will ignore this for the moment to keep the code simple. fun createDataFrame(select: SqlSelect, tables: Map<String, DataFrame>) : DataFrame { // get a reference to the data source var df = tables[select.tableName] ?: throw SQLException("No table named '${select.tableName}'") // create the logical expressions for the projection val projectionExpr = select.projection.map { createLogicalExpr(it, df) } if (select.selection == null) { // if there is no selection then we can just return the projection return df.select(projectionExpr) } // create the logical expression to represent the selection val filterExpr = createLogicalExpr(select.selection, df) // get a list of columns references in the projection expression val columnsInProjection = projectionExpr .map { it.toField(df.logicalPlan()).name} .toSet() // get a list of columns referenced in the selection expression val columnNames = mutableSetOf<String>() visit(filterExpr, columnNames) // determine if the selection references any columns not in the projection val missing = columnNames - columnsInProjection // if the selection only references outputs from the projection we can // simply apply the filter expression to the DataFrame representing // the projection if (missing.size == 0) { return df.select(projectionExpr) .filter(filterExpr) } // because the selection references some columns that are not in the // projection output we need to create an interim projection that has // the additional columns and then we need to remove them after the // selection has been applied return df.select(projectionExpr + missing.map { Column(it) }) .filter(filterExpr) .select(projectionExpr.map { Column(it.toField(df.logicalPlan()).name) })
}

