An excellent first step is to write unit tests for the individual operators and expressions, asserting that they produce the correct output for a given input. It is also essential to cover error cases. Here are some suggestions for things to consider when writing unit tests: What happens if an unexpected data type is used? For example, calculating SUM on an input of strings. Tests should cover edge cases, such as using the minimum and maximum values for numeric data types, and NaN (not a number) for floating point types, to ensure that they are handled correctly. Tests should exist for underflow and overflow cases. For example, what happens when two long (64-bit) integer types are multiplied? Tests should also ensure that null values are handled correctly. When writing these tests, it is important to be able to construct record batches and column vectors with arbitrary data to use as inputs for operators and expressions. Here is an example of such a utility method. private fun createRecordBatch(schema: Schema, columns: List<List<Any?>>): RecordBatch { val rowCount = columns[0].size val root = VectorSchemaRoot.create(schema.toArrow(), RootAllocator(Long.MAX_VALUE)) root.allocateNew() (0 until rowCount).forEach { row -> (0 until columns.size).forEach { col -> val v = root.getVector(col) val value = columns[col][row] when (v) { is Float4Vector -> v.set(row, value as Float) is Float8Vector -> v.set(row, value as Double) ... } } } root.rowCount = rowCount return RecordBatch(schema, root.fieldVectors.map { ArrowFieldVector(it) })
