We are going to hand-code a SQL parser based on the Top Down Operator Precedence paper published by Vaughan R. Pratt in 1973. Although there are other approaches to building SQL parsers such as using Parser Generators and Parser Combinators, I have found Pratt's approach to work well and it results in code that is efficient, easy to comprehend, and easy to debug. Here is a bare-bones implementation of a Pratt parser. In my opinion, it is beautiful in its simplicity. Expression parsing is performed by a simple loop that parses a "prefix" expression followed by an optional "infix" expression and keeps doing this until the precedence changes in such a way that the parser recognizes that it has finished parsing the expression. Of course, the implementation of parsePrefix and parseInfix can recursively call back into the parse method and this is where it becomes very powerful. interface PrattParser { /** Parse an expression */ fun parse(precedence: Int = 0): SqlExpr? { var expr = parsePrefix() ?: return null while (precedence < nextPrecedence()) { expr = parseInfix(expr, nextPrecedence()) } return expr } /** Get the precedence of the next token */ fun nextPrecedence(): Int /** Parse the next prefix expression */ fun parsePrefix(): SqlExpr? /** Parse the next infix expression */ fun parseInfix(left: SqlExpr, precedence: Int): SqlExpr } This interface refers to a new SqlExpr class which will be our representation of a parsed expression and will largely be a one to one mapping to the expressions defined in the logical plan but for binary expressions we can use a more generic structure where the operator is a string rather than create separate data structures for all the different binary expressions that we will support. Here are some examples of SqlExpr implementations. /** SQL Expression */
interface SqlExpr /** Simple SQL identifier such as a table or column name */
data class SqlIdentifier(val id: String) : SqlExpr { override fun toString() = id
} /** Binary expression */
data class SqlBinaryExpr(val l: SqlExpr, val op: String, val r: SqlExpr) : SqlExpr { override fun toString(): String = "$l $op $r"
} /** SQL literal string */
data class SqlString(val value: String) : SqlExpr { override fun toString() = "'$value'"
} With these classes in place it is possible to represent the expression foo = 'bar' with the following code. val sqlExpr = SqlBinaryExpr(SqlIdentifier("foo"), "=", SqlString("bar"))
